import React from 'react';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';

function App() {
  return (
    <React.Fragment>
      <Router>
        <Switch>
          <Route exact path="/" component={HomePage}/>
          <Route exact path="/about" component={Extra}/>
          <Route exact path="/contact" component={DataBasePage}/>
        </Switch>  
      </Router>
    </React.Fragment>
  );
}

export default App;
